import React from 'react'

const DefinicoesPage = ({ sidebarMinimized, setSidebarMinimized }) => {
  return (
    <>
      <div className="w-full h-full flex justify-center rounded-lg bg-zinc-100 dark:bg-purple-950 shadow-lg hover:shadow- rounded-r-md  duration-500">
        <div className='flex flex-col  '>
            <h1 className='font-bold text-3xl text-black dark:text-white'>Perfil</h1>
        </div>
      </div>
      
    </>
  )
}

export default DefinicoesPage
